import React from 'react';
import { FaUser, FaEnvelope, FaBell, FaSignOutAlt } from 'react-icons/fa';
import '../assets/styles/ProfileNavBar.css';

const ProfileNavBar = ({ user }) => (
  <nav className="profile-navbar">
    <div className="profile-header">
      <div className="profile-picture"></div>
      <div className="profile-info">
        <h3>{user.name}</h3>
        <p>{user.email}</p>
      </div>
    </div>
    <div className="profile-links">
      <a href="#"><FaUser /> Profile</a>
      <a href="#"><FaEnvelope /> Messages</a>
      <a href="#"><FaBell /> Notifications</a>
      <a href="#"><FaSignOutAlt /> Logout</a>
    </div>
  </nav>
);

export default ProfileNavBar;
